import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <div id="login">
          <h1>First, log in to spotify</h1>
          <a href="/login">Log in</a>
        </div>
        <div id="loggedin">
        </div>
      </div>


    </div>
  );
}

export default App;
